import CourtCard from "../../components/CourtCard";
import { getCourtCrowdSummary } from "../../store/crowdStore";

export default function CourtList({ courts, computedById, selectedId, onSelect }) {
  if (!courts.length) {
    return (
      <div className="card" style={{ textAlign: "center" }}>
        <div className="h1">No matches ðŸ¥²</div>
        <div className="p" style={{ marginTop: 8 }}>Try a different island/skill/search.</div>
      </div>
    );
  }

  return (
    <div>
      {courts.map((c) => {
        const crowd = getCourtCrowdSummary(c.id);
        return (
          <CourtCard
            key={c.id}
            court={c}
            meta={computedById[c.id]}
            selected={selectedId === c.id}
            onClick={() => onSelect(c.id)}
            crowdAvg={crowd.avgPlayers}
          />
        );
      })}
    </div>
  );
}
